void dft::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_real_V_address0\" :  \"" << sample_real_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_real_V_ce0\" :  \"" << sample_real_V_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_real_V_we0\" :  \"" << sample_real_V_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_real_V_d0\" :  \"" << sample_real_V_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sample_real_V_q0\" :  \"" << sample_real_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_imag_V_address0\" :  \"" << sample_imag_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_imag_V_ce0\" :  \"" << sample_imag_V_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_imag_V_we0\" :  \"" << sample_imag_V_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sample_imag_V_d0\" :  \"" << sample_imag_V_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sample_imag_V_q0\" :  \"" << sample_imag_V_q0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

